import { Grid, Box } from '@mui/material';
import React from 'react';
import { useStyles } from './Styles';

const Cart = () => {
    const classes = useStyles();
    return (
        <div>
            <Grid container spacing={2} item xs={12} className={classes.mainCart}>
                <Grid>
                    <Box className={classes.menuPart}>
                        <Box className={classes.yellowCart}>
                            <Grid className={classes.pText}>
                                Lorem Ipsum
                            </Grid>
                            <p className={classes.pText}>The standard chunk of Lorem Ipsum used since the 1500s </p>
                        </Box>
                        <Box className={classes.yellowCart}></Box>
                        <Box className={classes.yellowCart}></Box>
                        <Box className={classes.yellowCart}></Box>
                    </Box>
                </Grid>
            </Grid>
        </div>
    );
};

export default Cart;
